import {planets} from '../data/planets.js'

function Home() {
  return (
    <>
      <div className="container mx-auto">
        <div className="hero min-h-full lg:mt-5 align-center py-5">
          <div>
            <div className="flex flex-col text-center items-center">
              <h1 className="text-5xl font-bold">Where would you like to go?</h1>
            </div>
          </div>
        </div>
        <p>Select From Planet: </p>
        <div className="grid grid-cols-4 mx-auto gap-4 justify-center text-center">
          {
            planets.map((planet) => (
              <div id={planet.id}>
                <button className="focus:border-4 focus:border-primary rounded-xl mx-auto">
                  <figure><img className="rounded-xl object-contain " src={`/images/${planet.image}`} alt="Titan" width={200} /></figure>
                </button>
              </div>
            ))
          }

</div>

      </div>
    </>
  );
}
export default Home;
